contract View{

    uint256 num1 = 2;
    uint256 num2 = 7;


    function getResults() public view returns(uint256, uint256){
        return (num1, num2);
    }

    function getResults2 () public view returns (uint256 product,uint256 total){
        uint256 num3 = 20;
        uint256 num4 = 30;

        product = num3 * num4;
