        num4 += 7;

    } 
    function getResults3 () public view returns (uint256 ,uint256 ){
        uint256 num5 = 20;
        uint256 num6 = 30;

        uint256 product1 = num5 * num6;
        uint256 total1 = num5 + num6;

        num5 += 5;
        num6 += 7;

